import React from "react";

function Footer() {
  return (
    <div className="footer">
      <footer class="py-5 bg-dark fixed-bottom">
        <div class="container">
          <p class="m-0 text-center text-white">
          <strong><p >
            GitHub: https://github.com/garciale24/PazaakPlayable.git 
          </p> </strong>
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
